import React from 'react';
import Layout from '../Layout/Layout';
import './home.css';
// icon
import FacebookIcon from '@material-ui/icons/Facebook';
import InstagramIcon from '@material-ui/icons/Instagram';
import TwitterIcon from '@material-ui/icons/Twitter';
import GitHubIcon from '@material-ui/icons/GitHub';

function Home() {
  return (
    <div>
      <Layout>
        {/* --- maindiv ---  */}
        <div className='main_div'>
          {/* --- background --- */}
          <img
            className='home_bg'
            src={require(`../Assets/Images/bg.jpg`)}
            alt='avatar image'
          />
          {/* --- background End --- */}

          {/* --- home info MainDiv--- */}
          <div className='home_info'>
            <q>Help others in the way of self-learning </q>
            {/* --- Skils Div --- */}
            <div className='skill_div'>
              <h3>my skills</h3>
              <div className='skills'>
                <li>
                  <a href='#'>Html</a>
                </li>
                <li>
                  <a href='#'>css</a>
                </li>
                <li>
                  <a href='#'>Bootstrap</a>
                </li>
                <li>
                  <a href='#'>Javascript</a>
                </li>
                <li>
                  <a href='#'>ReactJS</a>
                </li>
                <li>
                  <a href='#'>Wordpress</a>
                </li>
              </div>
            </div>
            {/* --- Skils Div End--- */}
          </div>
          {/* --- home info MainDiv End--- */}

          {/* --- Social Button Div --- */}
          <div className='social_shear__div'>
            <li>
              <a href='https://www.facebook.com/ritam.rahman4/'>
                <FacebookIcon />
              </a>
            </li>
            <li>
              <a href='#'>
                <InstagramIcon />
              </a>
            </li>
            <li>
              <a href='#'>
                <TwitterIcon />
              </a>
            </li>
            <li>
              <a href='#'>
                <GitHubIcon />
              </a>
            </li>
          </div>
          {/* --- Social Button Div End --- */}
        </div>
        {/* --- maindiv End ---  */}
      </Layout>
    </div>
  );
}

export default Home;
